//https://leetcode.com/problems/path-with-minimum-effort
class Solution {
public:
    int minimumEffortPath(vector<vector<int>>& heights) {
        priority_queue<tuple<int, int, int>, vector<tuple<int, int, int>>, greater<tuple<int, int, int>>> pq;
        int dx[] = {0, 0, 1, -1};
        int dy[] = {1, -1, 0, 0};
        pq.push({0, 0, 0});
        while(!pq.empty()){
            auto [effort, x, y] = pq.top();
            pq.pop();
            if(x == heights.size()-1 && y == heights[0].size()-1){
                return effort;
            }
            int val = heights[x][y];
            heights[x][y] = INT_MAX;
            for(int i=0; i<4; i++){
                int r = x + dx[i];
                int c = y + dy[i];
                if(r >= 0 && c >= 0 && r < heights.size() && c < heights[0].size() && heights[r][c] != INT_MAX){
                    pq.push({max(abs(val-heights[r][c]), effort), r, c});
                }
            }
        }
        return -1;
    }
};

